import React from 'react';
import { Container, Card, Jumbotron } from 'react-bootstrap';

function Home() {
  return (
    <Container className="mt-3">
      <Jumbotron>
        <h1>Welcome to Financial Diary!</h1>
        <p>
          Manage and track your financial assets in one place! Explore the latest market trends, manage your stock portfolio, and make informed investment decisions with our comprehensive financial tools.
        </p>
      </Jumbotron>
      <Card className="mb-3">
        <Card.Body>
          <Card.Title>Get Started</Card.Title>
          <Card.Text>
            Navigate through the dashboard to get an overview of your financial assets, manage assets in the Asset Management tab, and stay updated with the latest news in the Newsfeed section.
          </Card.Text>
        </Card.Body>
      </Card>
    </Container>
  );
}

export default Home;
